import React, { useState } from "react";
import axios from "axios";

function App() {
  const [videoUrl, setVideoUrl] = useState("");
  const [loading, setLoading] = useState(false);
  const [comments, setComments] = useState([]);
  const [summary, setSummary] = useState("");
  const [keywords, setKeywords] = useState([]);
  const [error, setError] = useState("");

  const extractVideoId = (url) => {
    try {
      const parsed = new URL(url);
      if (parsed.hostname === "youtu.be") return parsed.pathname.slice(1);
      if (parsed.hostname.includes("youtube.com")) {
        if (parsed.searchParams.has("v")) return parsed.searchParams.get("v");
        if (parsed.pathname.startsWith("/embed/"))
          return parsed.pathname.split("/embed/")[1];
      }
      return null;
    } catch {
      return null;
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    const videoId = extractVideoId(videoUrl);
    if (!videoId) {
      setError("Invalid YouTube URL");
      return;
    }

    setLoading(true);
    setComments([]);
    setSummary("");
    setKeywords([]);

    try {
      const res = await axios.post("http://localhost:5000/api/comments/url", { videoId });
      setComments(res.data.comments || []);
      setSummary(res.data.summary || "");
      setKeywords(res.data.keywords || []);
    } catch (err) {
      setError("Failed to fetch data");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 800, margin: "auto", padding: 20, fontFamily: "Arial" }}>
      <h2>YouTube Comment Analyzer</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Enter YouTube video URL"
          value={videoUrl}
          onChange={(e) => setVideoUrl(e.target.value)}
          style={{ width: "100%", padding: 10, marginBottom: 10 }}
        />
        <button type="submit" disabled={loading} style={{ padding: "10px 20px" }}>
          {loading ? "Analyzing..." : "Analyze"}
        </button>
      </form>

      {error && <p style={{ color: "red" }}>{error}</p>}

      {summary && (
        <div style={{ marginTop: 30 }}>
          <h3>ðŸ§  Summary & Insight</h3>
          <p>{summary}</p>
        </div>
      )}

      {keywords.length > 0 && (
        <div style={{ marginTop: 20 }}>
          <h4>ðŸ”‘ Extracted Keywords</h4>
          <div style={{ display: "flex", flexWrap: "wrap", gap: "10px" }}>
            {keywords.map((kw, idx) => (
              <span key={idx} style={{
                backgroundColor: "#f0f0f0",
                padding: "5px 10px",
                borderRadius: "5px"
              }}>{kw}</span>
            ))}
          </div>
        </div>
      )}

      {comments.length > 0 && (
        <div style={{ marginTop: 30 }}>
          <h3>ðŸ’¬ Sample Comments</h3>
          <ul style={{ maxHeight: 300, overflowY: "auto", padding: 0 }}>
            {comments.slice(0, 10).map((c, i) => (
              <li key={i} style={{ marginBottom: 15, listStyle: "none", borderBottom: "1px solid #ddd", paddingBottom: 10 }}>
                <strong>{c.author}</strong> ({c.likes} likes) â€” <em>{c.sentiment}</em><br />
                <span>{c.text}</span>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
